const FULFILLED = 'fulfilled';
const REJECTED = 'rejected';

class MyPromise {
  constructor(exec) {
    this.status = PENDING;
    this.value = null;
    this.reason = null;

    // resolve\u548Creject\u88AB\u56DE\u8C03\u7684\u65F6\u5019\uFF0C\u72B6\u6001\u6D41\u8F6C
    // \u8FD9\u91CC\u4F7F\u7528\u7BAD\u5934\u51FD\u6570\uFF0C\u7ED1\u5B9Aresolve\u548Creject\u7684this\u59CB\u7EC8\u6307\u5411MyPromise
    let resolve = (value) => {
      if (this.status === PENDING) {
        this.status = FULFILLED;
        this.value = value;
      }
    };

    let reject = (reason) => {
      if (this.status === PENDING) {
        this.status = REJECTED;
        this.reason = reason;
      }
    };
    // \u82E5\u6267\u884C\u5668\u62A5\u9519\uFF0C\u76F4\u63A5reject\u51FA\u53BB
    try {
      // \u6267\u884C\u5668\u4F20\u5165\u540E\u7ACB\u5373\u6267\u884C
      exec(resolve, reject);
    } catch (error) {
      reject(error);
    }
  }
}
